(29352, 87825, 2925, 1, 'KUSH', '2004 Demo\r\n\r\n', '2010-11-20 00:00:00', 2000, 0, 2, 7, '已經疲憊害怕睜開雙眼\r\n怕看見這世界變太美\r\n沈靜在自己空虛的臉\r\n站在時間轉動的邊緣\r\n\r\n你是否也覺得很美\r\n不用在逃避這個世界\r\n枯萎的花還是很美\r\n燒玩後的煙\r\n\r\n刺痛了雙眼\r\n敏銳了嗅覺\r\n讓我擋不住淚水\r\n我看見對面\r\n有我的從前\r\n和一個新的明天  選誰\r\n\r\n或許在明天\r\n我閉上雙眼\r\n就會忘記我是誰\r\n記憶很完美\r\n但都是傷悲\r\n誰來想起這一切\r\n', '', 262, '', '靖', '靖', '', '', '', 0, 1, 0, '2010-11-16 20:30:05', '2015-03-12 13:44:26', '0000-00-00 00:00:00'),
(29353, 87825, 2925, 2, 'Everyone Is God', '2003 新竹 Underground Live Recording', '2010-11-20 00:00:00', 2000, 0, 2, 7, '我們大家都還是一樣在迷惘\r\n迷惘人群一直想要的渴望\r\n會不會受傷沒有人去想\r\n沒有人在乎只是因為他們怕…\r\n怕被同情過後還是的被希望\r\n希望只是一則可怕的笑話\r\n人人都在等待他們的理想\r\n但始終都還沒有發現自己還在迷惘\r\nRap\r\n到底誰在唱 唱到了神也會怕\r\n到底誰在唱 唱出了你的傷疤\r\n到底誰在唱 在抵抗 所有來自身邊的可怕的笑話\r\n神說他不會迷惘\r\n原來神他自己也會說謊\r\n他給人類製造了慾望\r\n所以人才會花錢去讓他爽\r\n人都是一樣在受傷*\r\n因為受傷才能讓人成長*\r\n人家說的理想和慾望*\r\n它們彷彿站在同一條船上\r\n(他們彷彿都站在同一條船上 神說他不會說謊..哼)\r\n我們擁有的慾望 和希望有的理想\r\n如今都被操控在神手上\r\n如果結果都一樣 那又為何還要裝\r\nEVERYONE IS GOD~~\r\n經過了我無知的想法(哼)\r\nThink that everyone can be god\r\nJust like the song\r\n"One of us"\r\nit''s just this song 他比較嗆.....\r\n\r\n', '', 268, '', '靖', '靖', '', '', '', 0, 1, 0, '2010-11-16 20:33:44', '2015-03-12 13:44:26', '0000-00-00 00:00:00'),
(29354, 87825, 2925, 3, 'Want You to Know', '2004 Demo', '2010-11-20 00:00:00', 2000, 0, 2, 7, 'I am just too selfish leaving you there waiting\r\nThis song is for speaking The words inside of me\r\nEveryday we’re loosing Time for me to miss you\r\nThe way I miss you…\r\nBut I’m not alone I know you’re there waiting\r\nCause I’m the guy that you intend to be with\r\nFor all of the love I think we should carry on carry on\r\nUntil the time that I’m born in next life\r\nSorry I lost control Sorry I screamed at you\r\nI’m not perfect but we’re learning\r\nIf I made you cry please forgive me 我把心給你看\r\nAnd I just want you to know how much I love you (and I ment it)\r\n*message from me to you telling you how I feel\r\nHope I’m there with you and I miss you\r\nI miss you~~\r\n\r\n', '', 284, '', '靖', '靖', '', '', '', 0, 1, 0, '2010-11-16 20:37:42', '2015-03-12 13:44:26', '0000-00-00 00:00:00'),
