(29357, 87825, 2925, 6, '話', '', '2010-11-20 00:00:00', 2000, 0, 2, 7, '我光纖亮麗的外表造成了我許多的痛苦與煩惱\r\n煩惱著不被討好 卻又逃不掉上天的圈套\r\n一直阻擋著我 好像捆著我的手讓我不能輕鬆\r\n給過太多包容 牽過太多虛假的手\r\n給過太多理由 讓自己能夠接受\r\n所有的背判 都是上天安排為了給你有更好的未來 \r\n所以請好好珍惜失敗\r\n但是我一次次失敗 還是沒有人給我愛\r\n還是我根本就不該存在在這世界上等待\r\n像個白痴在等待傷害\r\n卻還看不到未來 可愛可愛 可憐沒人愛\r\n人若為善 福雖未至 但禍已遠離\r\n我很相信自己 就算再沒用也要對的起自己\r\n人若為惡 禍雖未至 但福已遠離\r\n你要相信自己 別輕意犯錯但也尊重自己的決定\r\n我的人在哪裡 心在哪裡 \r\n再背後挺著我自尊的那個靈魂他現在在哪裡\r\n其實我不知道 到底要怎樣討好\r\n才能在這個社會上踏出夢的第一腳\r\n人不再可靠 夢變的渺小\r\n這是我一直以來的惡夢卻被夢到 很好笑\r\n很抱歉 人不可靠 只有自己才能信的過 誰是罪愧禍首\r\n而之前那些沒有愛過我的小丑 你們也只能待在我生命中的某個角落\r\n一直墮落 帶上面具準備明天要演的幾場SHOW\r\n其實她們的生活比我想像中的還要墮落\r\n抽煙 喝酒 呼麻 其實他們樣樣都通\r\n再加上幾顆E就能把她們全部一起騙到手\r\n只有這時才會覺得自己不錯\r\n至少那時的我在她們眼中很想要被用\r\n\r\n', '', 267, '', '靖', '靖', '', '', '', 0, 1, 0, '2010-11-16 20:47:43', '2015-03-12 13:44:26', '0000-00-00 00:00:00'),
(29358, 87825, 2925, 4, 'IF...', '2005 Taiwan Recording\r\nDemo', '2010-11-20 00:00:00', 2000, 0, 2, 10, '這次分開不會再短暫 (我猜) 你已離開 (離開)\r\n你無心傷害\r\n我的心還是痛到要害 (分開) 怎麼分開 怎麼醒不過來\r\n我閉上眼睛 停之呼吸 至少這一刻能安靜\r\n回想我們兩人的事情\r\n或許你只要我愛你多一點 \r\n或許你可能一切都沒改變\r\n或許再作夢 或許我已經沒救\r\n你還是要選擇離我遠一點\r\n連星星的距離都沒比你遠\r\n我還想要求 看來是我想太多\r\n我有話想對你說 我心裡的感受\r\n我就是不願放手\r\n\r\n', '', 246, '', '靖', '靖', '', '', '', 0, 1, 0, '2010-11-16 21:30:20', '2015-03-12 13:44:26', '0000-00-00 00:00:00'),
