(29361, 11522, 0, 1, '自以為', '', '2010-11-13 00:00:00', 2000, 0, 2, 3, '你不說，我不說。捉摸不透，你的沈默\r\n看著我，別開口，都只是聽說，都只是想的太多\r\n\r\nHey, it''s too late\r\n所有的自以為，都留在那天\r\nHey, it''s okay\r\n放不下的那些，再沒有埋怨\r\n\r\n看一眼，再一眼。看不清楚，你的唇眉\r\n先別說，別開口，雖然並不是、不是刻意要錯過\r\n\r\nHey, it''s too late\r\n所有的自以為，都留在那天\r\nHey, it''s okay\r\n現在別說後悔，也不必紀念\r\n\r\n看，花滿枝枒的昨天，重複離別\r\n看，日出日落的轉眼\r\n\r\nHey, it''s too late\r\n所有的自以為，都留在那天\r\nHey, it''s okay\r\n放不下的那些，原來不過都只是錯覺\r\n', '', 249, '', 'CocoaBed', '紀紀', 'CocoaBed', '', '', 0, 0, 1, '2010-11-17 01:56:14', '2013-10-07 17:17:20', '0000-00-00 00:00:00'),
