(29364, 87719, 0, 1, 'Chicken Song', '', '2010-11-17 00:00:00', 2000, 20, 0, 3, 'Chicken Song\r\n\r\nChickens don’t fly overhead       if they don’t hear a sound\r\n雞雞不會飛過頭                        如果他們沒有聽到聲音\r\nAll the pretty flowers in my head       are spinning around\r\n我頭上美麗的花兒    		到處飛啊飛	\r\nCharlie walks his dog       and then he lets him run around\r\n查禮狗散步			然後讓狗溜了\r\nHe leaves chocolate treats and        by the children they are found\r\n他留下的巧克力                             讓小孩子找到了  \r\n\r\nDo do do do do do do do do do do do do\r\n\r\nWhat is so amazing       about things found on the ground\r\n草地上有什麼                讓人驚訝的好東西\r\nOr the little toys      you see that make      a squeaky sound\r\n還是你                  看到的那些    會發出聲音的玩具\r\n\r\nDon’t lie to me world,        I’ve known what I seen\r\n世界不用欺騙我             我知道我看到了甚麼\r\nDon’t cry for me girl,        I’ll change everything      (you know I will!)\r\n女孩別為我哭泣               我會改變這一切               你知道我會的\r\n\r\nChickens don’t fly overhead         if they don’t hear a sound\r\n雞雞不會飛過頭                        如果他們沒有聽到聲音\r\nMr. Jones went walking        with his one foot      on the ground\r\n瓊斯先生                          在草地上                 走走跳跳                   \r\nHis boy Charlie        with the children         liked to fool around\r\n他兒子察理              跟其他小孩                    喜歡到處玩\r\nDrawing pictures     of balloons      the people    they  astound\r\n 畫了幾個                    氣球                   大家        拍手叫好\r\n', '', 256, '', '', 'Melanie Hanson & Paul Despins', 'Nude On The Radio', '', '', 1, 1, 0, '2010-11-17 02:07:26', '2015-03-12 13:44:26', '0000-00-00 00:00:00'),
(29365, 87719, 0, 1, 'Tokyo', '', '2010-11-17 00:00:00', 2000, 20, 0, 10, 'Tokyo\r\n\r\nYo yo yo my name is Tokyo, \r\n唷 唷 唷 我叫做Tokyo\r\nI’m out to cut a rug,        haven’t had enough no\r\n我要盡情狂歡             再多也不嫌多\r\nYo yo yo my name is Tokyo, \r\n唷 唷 唷 我叫做Tokyo\r\nif you don’t like my spiky hair,       fuck I don’t care\r\n如果你看不慣我的刺蝟頭               幹 那又怎樣\r\n\r\nI’m a financial buff,    I’m really a financial buff,       and I’m really buff, too!\r\n我愛錢                       我有錢                                    肌肉也不輸人\r\n\r\nSpend your leisure time,        doing your best to get to him\r\n花用你的時間                  極盡一切可能靠近他                    \r\nBut if you let your guard down,        he’s got you against the fence\r\n可是如果你卸下武裝                  他就得程了\r\n\r\nIf you could see your face,      well you’d know      you’d been had so bad\r\n如果你看看你自己              你就會知道              他玩弄了你\r\nSo squeeze your juices off        and try to remember…\r\n所以聰明的你                             盡情享受吧     \r\n', '', 134, '', 'Hunter & Tate Schulz', 'Hunter Schulz', 'Nude On The Radio', '', '', 1, 1, 0, '2010-11-17 02:07:44', '2015-03-12 13:44:26', '0000-00-00 00:00:00'),
(29366, 87719, 0, 1, 'Roshambo', '', '2010-11-17 00:00:00', 2000, 0, 1, 8, 'Roshambo\r\n\r\nI don’t believe in the apocalypse\r\n我信的不是大道理\r\nI don’t believe in the end of times\r\n我信的不是世界末日\r\nI don’t believe in the solar eclipse\r\n我信的不是日蝕\r\nI don’t believe in Valentine’s\r\n我信的不是情人節\r\n\r\nI don’t believe I asked opinion,           I don’t believe I stretched the truth\r\n我不在乎你的想法                         我也不是隨性誇口\r\nI am not looking for a bargain,           All I believe in is you\r\n我要的不是妥協                                     我所信的就是你\r\n\r\nI don’t believe in everything I’ve read\r\n我信的不是我所讀過的東西\r\nI don’t believe in promises\r\n我信的不是保證\r\nI don’t believe in compromising\r\n我信的不是讓步\r\nMy own beliefs inside my head\r\n我自己腦中的原則\r\n', '', 204, '', 'The Network', 'The Network', 'Nude On The Radio', '', '', 1, 1, 0, '2010-11-17 02:08:07', '2015-03-12 13:44:26', '0000-00-00 00:00:00'),
(29367, 87719, 0, 1, 'Transmission', '', '2010-11-17 00:00:00', 2000, 0, 1, 8, 'Transmission\r\nRadio,     live transmission\r\nRadio      live放送\r\nI listen to the silence, I let it ring on,  my eyes dark grey   are frightened of the sun\r\n聽著寂靜的聲音          我讓它繼續       灰暗的眼睛               懼怕陽光\r\nWe would have a fine time         living in the night\r\n我們在夜晚                                  會活得很愉快\r\nLeft to blind destruction,        waiting for our sight…. Our sight\r\n白日的美好已不在             只為等待那夜晚的霓紅                   \r\nWe would go on as though nothing was wrong, \r\n我們繼續下去似乎一切正常\r\nHide from these days      we remain all alone\r\n逃避這一切                        我們依然孤單\r\nStaying in the same place,     just staying out the time\r\n待在同樣的地方                           無盡的等待                      \r\nTouching from a distance,       further all the time\r\n現實越來越遙遠                    回頭無可期\r\nDance        to the radio\r\n隨著radio    跳舞吧\r\nWell I could call out       when the going gets tough\r\n我會求救                           當事情不再那麼簡單的時候\r\nThe things that we’ve learned       are no longer enough\r\n我們所擁有的                                     不再足夠\r\nNo language just sound,        that’s all we need to know\r\n沒有言語是完美的                  這是我們所要知道的\r\nThe synchronized love       to the beat of the show\r\n戀著樂聲的夜晚              隨著音樂的節奏\r\nWe could dance!     盡情的舞吧\r\n', '', 265, '', 'Joy Division', 'Ian Curtis ', 'Nude On The Radio', '', '', 1, 1, 0, '2010-11-17 02:09:06', '2015-03-12 13:44:26', '0000-00-00 00:00:00'),
(29368, 87719, 0, 1, 'Te Quiero', '', '2010-11-17 00:00:00', 2000, 0, 1, 3, 'Te Qiero\r\n\r\nI hear you knocking       at my back door,      coming around       cuz you want more\r\n我聽見你敲著                  我的後門                    徘徊著                       只因你想得到更多\r\nWell I’m feeling      a little sore,        you had me crawling       on the floor\r\n但我覺得                   有點痛               你讓我掙扎地                     倒在地上\r\n\r\nTe Qiero (I Love You)\r\n我愛你\r\n\r\nListen darling,      I confess       I’m getting       tired of saying YES\r\n親愛的                    聽我說          我已經               不想再點頭\r\nI can’t help you       in your quest…       it’s time for us        to take a rest\r\n我不能滿足              你的渴求                 我們倆該是時候     停下腳步\r\n\r\nMemories of you     haunt me like ghosts,      In my heart     they play host\r\n你的種種                   揮之不去地折磨著我      在我心中          牽絆著我\r\nTo the fact that you cared for       and loved me the most\r\n你對我的在乎                                    你對我的愛\r\nI fear they’ve got me      strung from a post\r\n我只怕這一切                  將我懸在半空中\r\n', '', 280, '', 'Tate Schulz & Star 69', 'Paul Despins', 'Nude On The Radio', '', '', 1, 1, 0, '2010-11-17 02:09:42', '2015-03-12 13:44:26', '0000-00-00 00:00:00'),
