(29370, 58255, 0, 1, 'Shiny Gold', '錢跟女人，誰能不愛，但是這些東西真的可以讓你有存在感嗎?\r\n\r\n找你心的方向，努力的去幹，不管失敗或成功。\r\n\r\n我們都是這樣活著的，不是嗎?\r\n\r\n\r\n\r\n\r\n\r\n------------------------------------------------------------------------------------------------\r\n\r\n特別感謝：大B、屁黃與胡屁，因為你們的幫忙我們才能趕出這次的Demo!', '2010-11-17 00:00:00', 2010, 0, 1, 1, 'The gold is shiny\r\n\r\nThe chick is pretty hot\r\n\r\nwe like both\r\n\r\nyou may be suffering by having both\r\n\r\n\r\n\r\nYou may believe in fate,but  nothing comes out as planed\r\n\r\nwhy not enjoy life and go seeking for something\r\n\r\nit may be so hard,but it really exists\r\n\r\ntrust me and belive yourself\r\n\r\nDont  let  others . Dont let others trap you\r\n', '', 234, '', 'Long Hair Monster', 'Long Hair Monster', '', '', '', 0, 0, 1, '2010-11-17 03:34:11', '2013-10-07 17:17:21', '0000-00-00 00:00:00'),
(29371, 84478, 0, 1, '失眠', '睡不著，就寫歌吧。', '2010-11-17 00:00:00', 2000, 0, 1, 7, '黑夜他之所以美 是因為城市無法入睡\r\n\r\n街燈在閃耀是非 故事在思緒裡盤旋\r\n\r\n緊握有縫隙會飛  放太鬆夢想容易碎\r\n\r\n這世界規矩太易醉 醉了卻無法成眠\r\n\r\n\r\n喝了水 吃了藥 轉了身 翻了枕  發瘋的另人崩潰\r\n\r\n\r\n闔上眼 夢下淺 困腦海 又擱淺  被惡魔凌遲的夜\r\n\r\n\r\n\r\n我不要失眠 不需要失眠 要怎麼睡\r\n\r\n憔悴的光輪兩圈  圍繞在靈魂窗前\r\n\r\n我不要失眠 不需要失眠 要怎麼睡\r\n\r\n當我背誦著詩篇  照亮最後一頁  \r\n\r\n是一道    光線\r\n\r\n\r\n我又沒睡~~~  WOO~~~OHOH  \r\n\r\n', '', 126, '', '陳零九', '陳零九', '陳零九', 'T-Work', '', 0, 1, 0, '2010-11-17 04:06:49', '2015-03-12 13:44:26', '0000-00-00 00:00:00'),
