(29391, 79820, 0, 1, '我在九歌之中聽見你名的聲音', '四書作業寫不出來，拿起各體文選作業起來亂錄。', '2010-11-18 00:00:00', 2000, 0, 1, 6, '我在九歌之中聽見你名的聲音\r\n每個人都會吟誦你底\r\n某段詩句。\r\n恰若青石的街道向晚，你說。\r\n\r\n再我被疑惑漆成藍色的少年或許\r\n和你同有一種思鄉情緒。也許你正思念著北平而我們\r\n同時思念著夢境。\r\n在那抔夢土上，燕人起行。\r\n終究看見亞熱帶的炎夏之中亦存有一種無限底\r\n雪的可能\r\n在這小小的島上。\r\n\r\n而你\r\n你是寂寞的人坐著看花\r\n\r\n你是寂寞的人坐著\r\n坐著看花。\r\n', '', 293, '', 'yunching wu', 'yunching wu', '', '', '', 0, 0, 1, '2010-11-18 01:26:04', '2013-10-07 17:17:21', '0000-00-00 00:00:00'),
